import React, { useDebugValue } from "react";
import {EnfantUserx} from '../../data';
import EnfantCard from './PagesProprio/EnfantCard';









 const EnfantSlider = () => { 

  const datacamp= EnfantUserx.map((data) => {

    return (
      <EnfantCard key={data.key} nom={data.nom} prenom={data.prenom} Age={data.Age} image={data.image} />
    )
  }) 

  
      return ( 
      <div className="w-full grid pio:grid-cols-2 ">
             {datacamp}
      </div>
            

          );
        };

 export default EnfantSlider;
